local function BuildBlueprint(Name,Position)
    if game:GetService("Players").LocalPlayer.PlayerBlueprints.Blueprints:FindFirstChild(Name) then
        game:GetService("ReplicatedStorage").PlaceStructure.ClientPlacedBlueprint:FireServer(Name, Position, game.Players.LocalPlayer)
    end
end

local previewFolder = Instance.new("Folder",workspace)

local function Preview(Name,WoodClass,Position)
    local part = game:GetService("ReplicatedStorage").Purchasables.Structures.BlueprintStructures:FindFirstChild(Name):FindFirstChild('Model'):Clone()
    part.Parent = previewFolder
    part:PivotTo(Position)
    part.Name = "Perviw"
    local treeValue = Instance.new("StringValue", part)
    treeValue.Name = "TreeValue"
    treeValue.Value = WoodClass

    for i,v in pairs(part:GetChildren()) do
        if v:IsA("Part") then
            v.Color = Color3.fromRGB(204, 142, 105)
        end
	end
	
    for _, _Part in pairs(part:GetChildren()) do
        if _Part:IsA('BasePart') and _Part.Transparency == 0 then
            _Part.Transparency = 0.3
        end
    end
end

